(15, 2383, 'Như', 'asamilee19@gmail.com', '', '113.190.193.66', '2018-09-06 20:15:34', '2018-09-06 13:15:34', 'Phải nói đây là chap mình thích nhất của Sakura. Phải kể ntn: Sak là 1 cô gái bình thường, cô ko có mục tiêu hay động lực to lớn như Nar, cũng ko có nỗi hận thù như Sas, bố mẹ cô bt, gia cảnh bt, ko năng lực đặc biệt hay huyết kế giới hạn, cô chỉ muốn trải qua quãng tgian đi học như bao người khác, như Ino. \nNhưng vì cô chung nhóm với 2 tên đặc biệt kia khiến cô phải nỗ lực rất nhiều để vượt qua cái bt ấy, để tiến tới 2 đồng đội của cô. Nếu t là Sak, t sẽ nghĩ \"đang yên đang lành sao gặp đúng 2 tên cá biệt?!\" \nPhải nói từ đầu arc Chunin tới giờ, mọi biến đều xuất phát từ Sas mà ra. Sak và Nar phải chịu trận chung, và điều mình thích nhất ở Sak đó là cô ấy dùng đầu óc mình để đối phó với hiểm nguy vì cô ấy bt, đầu óc là thứ duy nhất cô ấy có. Đây là 1 chuyển biến vô cùng to lớn đối với 1 cô gái bt, đứng trước bọn nó và đối đầu như vậy là 1 sự dũng cảm ko phải ai cũng làm được. \nCái mình ghét ở Sakura là cách Kishi ko chú tâm vào cô, ông nói ông yêu nv này nhưng cho cô quá ít đất diễn để toả sáng, để dành nó cho Sas và Nar. Sak làm nền để 2 tên kia toả sáng, vì thế mn nói cô ấy vô dụng. Ko t ko thấy cô ấy vô dụng, cô ấy có character development tốt nhưng tiếc thay cô ấy chỉ là bánh bèo đam mĩ cho couple nào kia', 0, '1', '', 'comment', 0, 0),
